import React, { useState } from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { Facebook } from 'react-bootstrap-icons';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';


// ... (import statements)

function HomePage() {
    const [error, setError] = useState('');
    const api_url = "http://localhost:3004";
    const navigate = useNavigate();
  
    const getBannersShopsloca = async (value) => {
      try {
        const response = await axios.get(`${api_url}/banners`, { params: { value } });
        if (response.status === 200) {
          const { token } = response.data;
          localStorage.setItem('jwtToken', token);
          navigate("/samsung");
        } else {
          setError("Login failed");
        }
      } catch (error) {
        setError("Login failed");
      }
    };
  
    const handleSamsungImageClick = () => {
      getBannersShopsloca("SamSungS23");
    };
  
    const handlePlaceholderImageClick = () => {
      // Handle click for the second image or any other placeholder logic
      // You can add specific logic for each image click handler
    };
  
    return (
      <div className="d-flex flex-column justify-content-between" style={{ minHeight: '100vh' }}>
        {/* ... other components ... */}
        {/* First Row */}
        <Row className="justify-content-center">
          <Col xs={6} md={6} className="text-center">
            <img
              onClick={handleSamsungImageClick}
              id="imagemod"
              src="https://img.global.news.samsung.com/th/wp-content/uploads/2023/02/Galaxy-S23-Series_KV_Product_2p_LI-1024x724.jpg"
              alt="Slot 1"
              className="img-fluid"
              data-value="SamSungS23"
            />
          </Col>
          <Col xs={6} md={6} className="text-center">
            <img
              onClick={handlePlaceholderImageClick}
              id="imagemod"
              src="https://via.placeholder.com/500"
              alt="Slot 2"
              className="img-fluid"
            />
          </Col>
        </Row>
        {/* ... other components ... */}
      </div>
    );
  }
  
  export default HomePage;
